(function( $ ){
    $(document).ready(function() 
    {
		var showSplash = function(){
			$.metroMessageBox({
				  title: '{:file} ({:advertiser})', 
				  content: "Type your name below to open the file",
				  buttons:["Click to Open"],
				  input: "text",
				  placeholder: "",
				  opacity: 1,
				  backgroundcolor: '#ffffff',
				},function( action, buttom, value, selectedText ){
					var userName = value;
					if(userName!= '')
					{
						window.open('public.html?User='+userName, "_self");
					}
					else
					{
						alert("Please type your Name");
						showSplash();
					}
			});		
		};
		showSplash();
    });
})( jQuery );

(function( $ ){
	var getUrlParameter = function(sParam)
	{
		var sPageURL = window.location.search.substring(1);
		var sURLVariables = sPageURL.split('&');
		for (var i = 0; i < sURLVariables.length; i++) 
		{
			var sParameterName = sURLVariables[i].split('=');
			if (sParameterName[0] == sParam) 
			{
				return decodeURI(sParameterName[1]);
			}
		}
		return '';
	};     
    $(document).ready(function() 
    {
		var user = getUrlParameter('User');
		var activityActionUrl = '{:siteUrl}' + '/activity/write'
		window.onbeforeunload =  function () { 
			$.ajax({
				type: "PUT",
				url: activityActionUrl,
				data: {
					type: 'Public Presentation',
					subType: 'Close',
					details: {
					                  User: user,
						Site: window.location.href,
						Name: $('head title').text(), 
						Advertiser: '{:advertiser}'
					}
				},
				async: false,
				dataType: 'json'
			});   
		};
		$.ajax({
			type: "PUT",
			url: activityActionUrl,
			data: {
				type: 'Public Presentation',
				subType: 'Open',
				notificationRecipients: '{:emails}',
				details: {
					User: user,
					Site: window.location.href,
					Name: $('head title').text(), 
					Advertiser: '{:advertiser}'
				}
			},
			async: true,
			dataType: 'json'
		});   
    });
})( jQuery );

(function($){var escapeable=/["\\\x00-\x1f\x7f-\x9f]/g,meta={'\b':'\\b','\t':'\\t','\n':'\\n','\f':'\\f','\r':'\\r','"':'\\"','\\':'\\\\'};$.toJSON=typeof JSON==='object'&&JSON.stringify?JSON.stringify:function(o){if(o===null){return'null';}
var type=typeof o;if(type==='undefined'){return undefined;}
if(type==='number'||type==='boolean'){return''+o;}
if(type==='string'){return $.quoteString(o);}
if(type==='object'){if(typeof o.toJSON==='function'){return $.toJSON(o.toJSON());}
if(o.constructor===Date){var month=o.getUTCMonth()+1,day=o.getUTCDate(),year=o.getUTCFullYear(),hours=o.getUTCHours(),minutes=o.getUTCMinutes(),seconds=o.getUTCSeconds(),milli=o.getUTCMilliseconds();if(month<10){month='0'+month;}
if(day<10){day='0'+day;}
if(hours<10){hours='0'+hours;}
if(minutes<10){minutes='0'+minutes;}
if(seconds<10){seconds='0'+seconds;}
if(milli<100){milli='0'+milli;}
if(milli<10){milli='0'+milli;}
return'"'+year+'-'+month+'-'+day+'T'+
hours+':'+minutes+':'+seconds+'.'+milli+'Z"';}
if(o.constructor===Array){var ret=[];for(var i=0;i<o.length;i++){ret.push($.toJSON(o[i])||'null');}
return'['+ret.join(',')+']';}
var name,val,pairs=[];for(var k in o){type=typeof k;if(type==='number'){name='"'+k+'"';}else if(type==='string'){name=$.quoteString(k);}else{continue;}
type=typeof o[k];if(type==='function'||type==='undefined'){continue;}
val=$.toJSON(o[k]);pairs.push(name+':'+val);}
return'{'+pairs.join(',')+'}';}};$.evalJSON=typeof JSON==='object'&&JSON.parse?JSON.parse:function(src){return eval('('+src+')');};$.secureEvalJSON=typeof JSON==='object'&&JSON.parse?JSON.parse:function(src){var filtered=src.replace(/\\["\\\/bfnrtu]/g,'@').replace(/"[^"\\\n\r]*"|true|false|null|-?\d+(?:\.\d*)?(?:[eE][+\-]?\d+)?/g,']').replace(/(?:^|:|,)(?:\s*\[)+/g,'');if(/^[\],:{}\s]*$/.test(filtered)){return eval('('+src+')');}else{throw new SyntaxError('Error parsing JSON, source is not valid.');}};$.quoteString=function(string){if(string.match(escapeable)){return'"'+string.replace(escapeable,function(a){var c=meta[a];if(typeof c==='string'){return c;}
c=a.charCodeAt();return'\\u00'+Math.floor(c/16).toString(16)+(c%16).toString(16);})+'"';}
return'"'+string+'"';};})(jQuery);
